import { Card, ProgressBar } from "react-bootstrap";
import styles from './card.module.css';

interface IProps { 
    title: string;
    text: string;
    footer?: number;
    funcao?: () => void; 
}

export default function ICard ({title, text, funcao, footer}: IProps) {
    return (
        <Card style={{ width: '18rem', textAlign: 'center', marginBottom: '20px' }} className={styles.card} onClick={funcao}>
        <Card.Body>
          <Card.Title>{title}</Card.Title>
          <Card.Text>
            tarefas: {text}
          </Card.Text>
        </Card.Body>
        <Card.Footer>
        <ProgressBar now={footer} /> {footer?.toFixed(1)}%
        </Card.Footer>
      </Card>
    )
}
